import React, { useEffect } from 'react';
import axios from 'axios';
import { response } from 'express';

function Landing() {
    useEffect(()=> {
        axios.get('/api/landing')
        .then(response=>{console.log(response)})
    },[])
    return (
        <div>landing</div>
    )
}
